import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaUserCircle, FaSignOutAlt, FaHamburger } from 'react-icons/fa';  // Using icons for profile and logout
import './header.module.css';

const Header = () => {
  const navigate = useNavigate();
  const isAuthenticated = localStorage.getItem('token') !== null;

  const profile = () => {
    navigate('/profile');
  };

  const diet = () => {
    navigate('/diet');
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('userId');
    navigate('/login');
  };

  return (
    isAuthenticated && (
      <header className="header">
        <div className="header-content">
          {/* Logo */}
          <div className="logo" onClick={() => navigate('/')}>
            <h1>FoodieApp</h1> {/* You can replace this with an actual logo */}
          </div>

          {/* Navigation Menu */}
          <nav>
            <ul className="nav-list">
              <li><button onClick={diet} className="nav-button"><FaHamburger /> Diet</button></li>
              <li><button onClick={profile} className="nav-button"><FaUserCircle /> Profile</button></li>
              <li><button onClick={handleLogout} className="nav-button"><FaSignOutAlt /> Logout</button></li>
            </ul>
          </nav>
        </div>
      </header>
    )
  );
};

export default Header;
